import React from 'react';

export const Landing = () => {
    return ( <
        div >
        <
        h1 > Welcome to my Home page < /h1>{' '} <
        div className = 'intro' >
        <
        p className = 'intro-body' >
        Hello and welcome to my portfolio where you will learn about my journey into the coding world!Here you learn about what languages I have learned in the past 3 years and what I hope to learn in the future as well!So buckle up and I hope you enjoy the site!Feedback is greatly appreciated as well!Thank you!
        <
        /p>{' '} <
        /div>{' '} <
        /div>
    );
};
